// StrictServerInterface represents all server handlers.
type StrictServerInterface interface {
	// Chat with the Agent
	// (POST /v1/agent/chat)
	AgentChat(ctx context.Context, request AgentChatRequestObject) (AgentChatResponseObject, error)
	// List all artifacts
	// (GET /v1/artifacts)
	ListArtifacts(ctx context.Context, request ListArtifactsRequestObject) (ListArtifactsResponseObject, error)
	// Delete an artifact
	// (DELETE /v1/artifacts/{id})
	DeleteArtifact(ctx context.Context, request DeleteArtifactRequestObject) (DeleteArtifactResponseObject, error)
	// Get artifact details
	// (GET /v1/artifacts/{id})
	GetArtifact(ctx context.Context, request GetArtifactRequestObject) (GetArtifactResponseObject, error)
	// List all conversations
	// (GET /v1/conversations)
	ListConversations(ctx context.Context, request ListConversationsRequestObject) (ListConversationsResponseObject, error)
	// Create a new conversation
	// (POST /v1/conversations)
	CreateConversation(ctx context.Context, request CreateConversationRequestObject) (CreateConversationResponseObject, error)
	// Delete a conversation
	// (DELETE /v1/conversations/{id})
	DeleteConversation(ctx context.Context, request DeleteConversationRequestObject) (DeleteConversationResponseObject, error)
	// Get conversation details
	// (GET /v1/conversations/{id})
	GetConversation(ctx context.Context, request GetConversationRequestObject) (GetConversationResponseObject, error)
	// Update conversation (e.g. title)
	// (PATCH /v1/conversations/{id})
	UpdateConversation(ctx context.Context, request UpdateConversationRequestObject) (UpdateConversationResponseObject, error)
	// Stream conversation events including sub-agent activity (SSE)
	// (GET /v1/conversations/{id}/events)
	StreamConversationEvents(ctx context.Context, request StreamConversationEventsRequestObject) (StreamConversationEventsResponseObject, error)
	// List messages in a conversation
	// (GET /v1/conversations/{id}/messages)
	ListMessages(ctx context.Context, request ListMessagesRequestObject) (ListMessagesResponseObject, error)
	// List all jobs
	// (GET /v1/jobs)
	ListJobs(ctx context.Context, request ListJobsRequestObject) (ListJobsResponseObject, error)
	// Submit a new Job (AWU)
	// (POST /v1/jobs)
	SubmitJob(ctx context.Context, request SubmitJobRequestObject) (SubmitJobResponseObject, error)
	// Get user job details
	// (GET /v1/jobs/{id})
	GetJob(ctx context.Context, request GetJobRequestObject) (GetJobResponseObject, error)
	// Serve a file directly from the job workspace
	// (GET /v1/jobs/{id}/files/{filename})
	ServeJobFile(ctx context.Context, request ServeJobFileRequestObject) (ServeJobFileResponseObject, error)
	// Stream job logs and status updates (SSE)
	// (GET /v1/jobs/{id}/stream)
	StreamJob(ctx context.Context, request StreamJobRequestObject) (StreamJobResponseObject, error)
	// List available models (from catalog)
	// (GET /v1/models)
	ListModels(ctx context.Context, request ListModelsRequestObject) (ListModelsResponseObject, error)
	// Discover models from Ollama and/or LiteLLM
	// (POST /v1/models/discover)
	DiscoverModels(ctx context.Context, request DiscoverModelsRequestObject) (DiscoverModelsResponseObject, error)
	// List all personas
	// (GET /v1/personas)
	ListPersonas(ctx context.Context, request ListPersonasRequestObject) (ListPersonasResponseObject, error)
	// Create a custom persona
	// (POST /v1/personas)
	CreatePersona(ctx context.Context, request CreatePersonaRequestObject) (CreatePersonaResponseObject, error)
	// Delete a persona
	// (DELETE /v1/personas/{id})
	DeletePersona(ctx context.Context, request DeletePersonaRequestObject) (DeletePersonaResponseObject, error)
	// Get persona details
	// (GET /v1/personas/{id})
	GetPersona(ctx context.Context, request GetPersonaRequestObject) (GetPersonaResponseObject, error)
	// Update persona
	// (PATCH /v1/personas/{id})
	UpdatePersona(ctx context.Context, request UpdatePersonaRequestObject) (UpdatePersonaResponseObject, error)
	// List all projects
	// (GET /v1/projects)
	ListProjects(ctx context.Context, request ListProjectsRequestObject) (ListProjectsResponseObject, error)
	// Create a new project
	// (POST /v1/projects)
	CreateProject(ctx context.Context, request CreateProjectRequestObject) (CreateProjectResponseObject, error)
	// Delete a project
	// (DELETE /v1/projects/{id})
	DeleteProject(ctx context.Context, request DeleteProjectRequestObject) (DeleteProjectResponseObject, error)
	// Get project details
	// (GET /v1/projects/{id})
	GetProject(ctx context.Context, request GetProjectRequestObject) (GetProjectResponseObject, error)
	// Update project (name, description)
	// (PATCH /v1/projects/{id})
	UpdateProject(ctx context.Context, request UpdateProjectRequestObject) (UpdateProjectResponseObject, error)
	// List artifacts in a project
	// (GET /v1/projects/{id}/artifacts)
	ListProjectArtifacts(ctx context.Context, request ListProjectArtifactsRequestObject) (ListProjectArtifactsResponseObject, error)
	// List conversations in a project
	// (GET /v1/projects/{id}/conversations)
	ListProjectConversations(ctx context.Context, request ListProjectConversationsRequestObject) (ListProjectConversationsResponseObject, error)
	// Get current settings (secrets masked)
	// (GET /v1/settings)
	GetSettings(ctx context.Context, request GetSettingsRequestObject) (GetSettingsResponseObject, error)
	// Update settings (encrypts secrets at rest)
	// (PUT /v1/settings)
	UpdateSettings(ctx context.Context, request UpdateSettingsRequestObject) (UpdateSettingsResponseObject, error)
	// Test provider connection
	// (POST /v1/settings/test)
	TestConnection(ctx context.Context, request TestConnectionRequestObject) (TestConnectionResponseObject, error)
}

type StrictHandlerFunc = strictnethttp.StrictHTTPHandlerFunc
type StrictMiddlewareFunc = strictnethttp.StrictHTTPMiddlewareFunc

type StrictHTTPServerOptions struct {
	RequestErrorHandlerFunc  func(w http.ResponseWriter, r *http.Request, err error)
	ResponseErrorHandlerFunc func(w http.ResponseWriter, r *http.Request, err error)
}

func NewStrictHandler(ssi StrictServerInterface, middlewares []StrictMiddlewareFunc) ServerInterface {
	return &strictHandler{ssi: ssi, middlewares: middlewares, options: StrictHTTPServerOptions{
		RequestErrorHandlerFunc: func(w http.ResponseWriter, r *http.Request, err error) {
			http.Error(w, err.Error(), http.StatusBadRequest)
		},
		ResponseErrorHandlerFunc: func(w http.ResponseWriter, r *http.Request, err error) {
			http.Error(w, err.Error(), http.StatusInternalServerError)
		},
	}}
}

func NewStrictHandlerWithOptions(ssi StrictServerInterface, middlewares []StrictMiddlewareFunc, options StrictHTTPServerOptions) ServerInterface {
	return &strictHandler{ssi: ssi, middlewares: middlewares, options: options}
}

type strictHandler struct {
	ssi         StrictServerInterface
	middlewares []StrictMiddlewareFunc
	options     StrictHTTPServerOptions
}

